tables.table_schema:
CREATE TABLE NutrientCyclingData (
    ID INT PRIMARY KEY,
    NutrientName VARCHAR(50),
    NutrientLevel FLOAT
);

CREATE TABLE EcosystemModel (
    ID INT PRIMARY KEY,
    EcosystemName VARCHAR(50),
    EcosystemType VARCHAR(50)
);

CREATE TABLE Nutrient_Cycling_Data (
    ID INT PRIMARY KEY,
    Nutrient_Type VARCHAR(50),
    Location VARCHAR(50),
    Nutrient_Concentration FLOAT
);

CREATE TABLE Ecosystem_Model (
    Model_ID INT PRIMARY KEY,
    Model_Name VARCHAR(50),
    Description TEXT,
    Last_Updated DATETIME
);
